describe('Insert comment and delete check', () => {
    let editor: DocumentEditor;
    let documentHelper: DocumentHelper;
    beforeAll((): void => {
        document.body.appendChild(createElement('div', { id: 'container' }));
        DocumentEditor.Inject(Editor, Selection, WordExport, SfdtExport, EditorHistory);
        editor = new DocumentEditor({ enableEditorHistory: true, enableWordExport: true, enableEditor: true, isReadOnly: false, enableSelection: true, enableSfdtExport: true, enableComment: true });
        editor.acceptTab = true;
        (editor.documentHelper as any).containerCanvasIn = TestHelper.containerCanvas;
        (editor.documentHelper as any).selectionCanvasIn = TestHelper.selectionCanvas;
        (editor.documentHelper.render as any).pageCanvasIn = TestHelper.pageCanvas;
        (editor.documentHelper.render as any).selectionCanvasIn = TestHelper.pageSelectionCanvas;
        editor.appendTo('#container');
        documentHelper = editor.documentHelper;
    });
    afterAll((done): void => {
        editor.destroy();
        document.body.removeChild(document.getElementById('container'));
        editor = undefined;
        setTimeout(function () {
            document.body.innerHTML = '';
            done();
        }, 1000);
    });
    it('Insert comment and delete check', () => {
        editor.open(JSON.stringify(commentDoc));
        editor.selection.select("0;22;0","0;22;123");
        editor.editor.insertComment('check');
        editor.editor.delete();
        expect(editor.selection.start.paragraph.isEmpty()).toBe(true);
        editor.editorHistory.undo();
        editor.editorHistory.redo();
        expect(editor.selection.start.paragraph.isEmpty()).toBe(true);
    });
    it('Insert comment and undo validation', () => {
        editor.openBlank();
        editor.editorModule.insertText("sample sample sample sample sample sample");
        editor.selection.select('0;0;7', '0;0;13');
        editor.editor.insertComment("sample");
        editor.selection.select('0;0;8', '0;0;15');
        editor.editor.onBackSpace();
         //No comment start
         expect(editor.element.getElementsByClassName('e-de-cmt-mark').length).toBe(0);
    });
    it("Comment start mark remove validation", () => {
        editor.openBlank();
        editor.editorModule.onEnter();
        editor.editorModule.insertText("sample");
        editor.editorModule.onEnter();
        editor.editorModule.insertText("sample");
        editor.selection.select('0;1;0', '0;2;7')
        editor.editorModule.insertComment("Hello");
        editor.selection.selectAll();
        editor.editorModule.onBackSpace();
        expect(editor.element.getElementsByClassName('e-de-cmt-mark').length).toBe(0);
    });
});
